import styled from "styled-components";

const Wrap = styled.div`
  display: grid;
  gap: 18px;
`;

const Q = styled.div`
  background: var(--card);
  border: 1px solid rgba(212,175,55,.18);
  border-radius: 16px;
  padding: 18px;
`;

const H2 = styled.h2`
  color: var(--gold-strong);
  text-align: center;
  margin-bottom: 18px;
`;

export default function FAQ() {
  return (
    <div className="container">
      <H2>Dúvidas Frequentes</H2>
      <Wrap>
        <Q>
          <strong>Esse método é para mim?</strong>
          <p>Se você já tem patrimônio, mas sente insegurança para tomar decisões, sim.</p>
        </Q>
        <Q>
          <strong>Preciso entender de economia?</strong>
          <p>Não. O método foi criado para pessoas ocupadas, que querem praticidade e resultado.</p>
        </Q>
      </Wrap>
    </div>
  );
}
